import Data from './videos.json'
import React from 'react'
import {Carousel} from 'react-bootstrap'
import ReactPlayer from 'react-pl'


export const Pilote = () => {



return (


    <div className='grid-container'>

    { Data.map( record => {

        // let a = require("" + record.src)

            return (

                <div className="box" key="record.id">
                    <div className='account'>
                        <a>{ record.title }</a>

                    </div>

                    <video className="v2" width="150" height="100" controls autoPlay={true} loop={true} id={record.id}
                    onClick={this.videoClick}>

                        <source src = {require(""+record.src)} type="video/mp4" />

                    </video>

                </div>


            )
        })
    }

    {/* <button onClick={view}>OK </button> */}



</div>

)

}


export default Pilote
